import Typewriter from "typewriter-effect";
import { ReactPhotoCollage } from "react-photo-collage";

const setting = {
    width: '600px',
    height: ['250px', '170px'],
    layout: [1, 4],
    photos: [
        // { source: 'public/image-1.jpg' },
        // { source: 'public/image-2.jpg' },
        // { source: 'public/image-3.jpg' },
        // { source: 'public/image-4.jpg' },
        // { source: 'public/image-5.jpg' },
        // { source: 'public/image-6.jpg' },
    ],
    showNumOfRemainingPhotos: true
};

export default function MainPage() {
    
    return (
        <>
            <ReactPhotoCollage {...setting}>
                <div style={{ backgroundImage: `url($)` }}>
                    <div className="px-4 py-5 my-5 text-center">
                        <h1 className="mx-auto display-1 nameText csep">Welcome!</h1>
                        <div className="mx-auto fs-2 siteText">
                            <Typewriter
                                onInit={(typewriter) => {
                                    typewriter
                                        .typeString("My name is Adrian Dorado, avid doer of things.")
                                        .pauseFor(1000)
                                        .deleteAll()
                                        .typeString("Contact me @ doradocoding@gmail.com")
                                        .pauseFor(1000)
                                        .deleteAll()
                                        .typeString("I hope you enjoy your stay <3")
                                        .start()
                                }}
                            />
                        </div>
                    </div>
                </div>
            </ReactPhotoCollage>
        </>
    );
}
